import React from 'react';
import '../../css/tweets/TweetTitle.css';

class TweetTitle extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {

        return (
            <div className="TweetTitle">
                <h2>{this.props.tweet_title}</h2>
            </div>
        );
    }
}

export default TweetTitle;
